from collections import Counter
from sympy import divisor_count
def auptor(rows):
    alst, inventory = [0], Counter([0])
    for m in range(1, rows):
        for k in range(m-divisor_count(m)+1):
            c = inventory[k]; alst.append(c); inventory.update([c])
    return alst
